import JobListPage from "./pages/JobListPage"; // Importer votre page de liste de jobs

function App() {
  return (
    <div className="App">
      <JobListPage />
      <ToastContainer position="top-right" autoClose={5000} hideProgressBar newestOnTop closeButton />
    </div>
  );
}

export default App;
